import React from "react";
import { BrowserRouter as Router, Switch, Route,Routes } from "react-router-dom";
import Home from "./pages/Home"

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/">{Home}</Route>
          </Routes>
      </div>
    </Router>
  );
};
export default App;
